import React from 'react'
import Catalog from '../catalog/catalog'
import Products from '../products/products'
import Header from '../header/header'
import {Route} from 'react-router-dom'
import Basket from '../basket/basket'

const classBackgroundData = ['background']
export function setBackgroundColor() {
  classBackgroundData.push('active')
  console.log(classBackgroundData)
}
export function unSetBackgroundColor() {
  classBackgroundData.splice(1)
  console.log(classBackgroundData)
}

const App = () => {
    return (
        <div className={classBackgroundData.join(' ')}>
            <Header />
            <Route path="/basket" component={Basket} />
            <Route path="/" exact component={Catalog} />
            <Route path="/" exact component={Products} />
        </div>
    )
}

export default App;
